import {useEffect,useState} from 'react';
import axios from 'axios';

//axiosリクエストを送信
const Example = () => {

  const [users,setUsers]=useState([])
  useEffect(()=>{
    const getUser=async()=>{
      const res =await axios.get('http://localhost:3003/user')
      setUsers(res.data)
    }
    getUser()
  })

  return (
    <div>
      
    </div>
  )
};


export default Example;
